var controlSymbol = new TcHmi.Symbol('%i%TempTargetIDString%/i%');
console.log("controlSymbol:");
console.log(controlSymbol);
var controlValue = controlSymbol.read();
console.log("controlValue:");
console.log(controlValue);
var control = TcHmi.Controls.get(controlValue);
console.log(control);
var symbol = new TcHmi.Symbol('%i%TempSymbolName%/i%');
console.log(symbol.read());
var value = '%s%' + symbol.read() + '%/s%';
console.log(value);
if(control){
    TcHmi.Binding.createEx(value, 'setValue', control);
}
console.log("Binding created!");
